import React from 'react';

const post = (props)=>(
    <div class="container">
        <div class="row">
            <div class="col-md-6">
                <h5>{props.name}</h5>
                <img src={props.image} alt=""/>
                <button >fav</button>
                <style jsx>
                {`
                    h5{
                        color: blue;
                    }
                    img {
                        max-width: 100%;
                        height: auto;
                    }
                `}    
                </style>
             </div>
        </div>
    </div>
   
);



export default post;
